import './App.css';
import React from 'react';

import axios from 'axios';

export default class GamesList extends React.Component {
  state = {
    socapi_socapi: []
  }

  componentDidMount() {
    axios.get(`http://127.0.0.1:8000/socapi`)
      .then(res => {
        const socapi_socapi = res.data;
        this.setState({ socapi_socapi });
      })
  }

  render() {
    return (
      <ul>
        { this.state.socapi_socapi.map(socapi => <li>{socapi.pre}</li>)}
      </ul>
    )
  }
}
